tables.table_schema:
CREATE TABLE quantum_gates (
    gate_id UUID PRIMARY KEY,
    gate_type VARCHAR(50),
    qubit_id INT,
    operation_time TIMESTAMP
);

CREATE TABLE gate_results (
    result_id UUID PRIMARY KEY,
    operation_id UUID REFERENCES gate_operations(operation_id),
    result_data JSONB,
    result_time TIMESTAMP
);

CREATE TABLE quantum_gates_operations (
    gate_id SERIAL PRIMARY KEY,
    gate_name VARCHAR(50) NOT NULL,
    operation_description TEXT,
    operation_date DATE
);

CREATE TABLE gate_results (
    result_id SERIAL PRIMARY KEY,
    gate_id INT REFERENCES quantum_gates_operations(gate_id),
    result_data JSONB,
    execution_time TIMESTAMP
);

CREATE TABLE qubit_states (
    qubit_id SERIAL PRIMARY KEY,
    qubit_name VARCHAR(50) NOT NULL,
    current_state TEXT,
    gate_id INT REFERENCES quantum_gates_operations(gate_id)
);

CREATE TABLE circuit_history (
    history_id SERIAL PRIMARY KEY,
    circuit_name VARCHAR(50) NOT NULL,
    performed_operations JSON,
    execution_status BOOLEAN
);

CREATE TABLE quantum_gates_operations (
    operation_id INT PRIMARY KEY,
    gate_name VARCHAR(50),
    operation_time TIMESTAMP,
    qubit_used INT
);

CREATE TABLE operation_results (
    result_id INT PRIMARY KEY,
    operation_id INT,
    result_value VARCHAR(50),
    result_description TEXT
);

CREATE TABLE quantum_circuits (
    circuit_id INT PRIMARY KEY,
    circuit_name VARCHAR(50),
    circuit_description TEXT
);

CREATE TABLE qubits (
    qubit_id INT PRIMARY KEY,
    qubit_name VARCHAR(50),
    qubit_status BOOLEAN
);
